import React, { useState, useEffect } from 'react';
import authService from '../../services/authService';


import './profesorCss/profesor.css';

const ProfesorDashboard = () => {
    const [user, setUser] = useState(null);
    const [selectedOption, setSelectedOption] = useState('');
    const [subSelectedOption, setSubSelectedOption] = useState('');
    const [subSubSelectedOption, setSubSubSelectedOption] = useState('');

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const userData = await authService.getUserData();
                setUser(userData);
            } catch (error) {
                console.error("Error al obtener datos del usuario:", error);
            }
        };
        fetchUserData();
    }, []);

    const handleMenuClick = (option) => {
        setSelectedOption(option);
        setSubSelectedOption('');
        setSubSubSelectedOption('');
    };

    const handleSubMenuClick = (subOption) => {
        setSubSelectedOption(subOption);
        setSubSubSelectedOption('');
    };

    const handleSubSubMenuClick = (subSubOption) => {
        setSubSubSelectedOption(subSubOption);
    };

    if (!user) {
        return <div>Cargando...</div>;
    }

    return (
        <div className="dashboard-container">
            <div className="sidebar">
                <nav className="menu">
                    <ul>
                        <li>
                            <button onClick={() => handleMenuClick('cursos')}>Cursos</button>
                            {selectedOption === 'cursos' && (
                                <ul className="submenu">
                                    <li>
                                        <button onClick={() => handleSubMenuClick('verCursos')}>Ver Cursos</button>
                                        {subSelectedOption === 'verCursos' && (
                                            <ul className="submenu">
                                                <li>
                                                    <button onClick={() => handleSubSubMenuClick('recursos')}>Recursos</button>
                                                </li>
                                            </ul>
                                        )}
                                    </li>
                                    <li>
                                        <button onClick={() => handleSubMenuClick('tareas')}>Tareas</button>
                                        {subSelectedOption === 'tareas' && (
                                            <ul className="submenu">
                                                <li><button onClick={() => handleSubSubMenuClick('verTareas')}>Ver Tareas</button></li>
                                                <li><button onClick={() => handleSubSubMenuClick('crearTareas')}>Crear Tareas</button></li>
                                            </ul>
                                        )}
                                    </li>
                                    <li>
                                        <button onClick={() => handleSubMenuClick('foros')}>Foros</button>
                                        {subSelectedOption === 'foros' && (
                                            <ul className="submenu">
                                                <li><button onClick={() => handleSubSubMenuClick('verForos')}>Ver Foros</button></li>
                                            </ul>
                                        )}
                                    </li>
                                    <li>
                                        <button onClick={() => handleSubMenuClick('asistencia')}>Asistencia</button>
                                        {subSelectedOption === 'asistencia' && (
                                            <ul className="submenu">
                                                <li><button onClick={() => handleSubSubMenuClick('verAsistencias')}>Ver Asistencias</button></li>
                                                <li><button onClick={() => handleSubSubMenuClick('tomarAsistencias')}>Tomar Asistencias</button></li>
                                            </ul>
                                        )}
                                    </li>
                                </ul>
                            )}
                        </li>
                    </ul>
                </nav>
            </div>
            <div className='main-content'>
                <div className='header'>
                    <h1>Bienvenido, {user.nombre}</h1>
                    <button onClick={authService.cerrarSesion}>Cerrar Sesi√≥n</button>
                </div>
                <div className='content'>
                    {subSubSelectedOption === 'verCursos' }
                    {subSubSelectedOption === 'recursos' }
                    {subSubSelectedOption === 'verTareas' }
                    {subSubSelectedOption === 'crearTareas' }
                    {subSubSelectedOption === 'verForos' }
                    {subSubSelectedOption === 'verAsistencias' }
                    {subSubSelectedOption === 'tomarAsistencias' }
                </div>
            </div>
        </div>
    );
};

export default ProfesorDashboard;
